import React from 'react';
import { Link } from 'react-router-dom';

function PicItem(props) {
  return (
    <>
      <li className='cards__item'>
          <figure className='cards__item__pic-wrap'>
            <img
              className='cards__item__img'
              alt='Travel Image'
              src={props.src}
            />
          </figure>
      </li>
    </>
  );
}

export default PicItem;
